import React, {Component, Link} from 'react';




function MyPage() {

  return (
    <main id="main" className="container">
       <h1>My Porsche</h1>
       <div>
            <h2>My Reservation</h2>
            <p>딜러와의 예약을 통해 꿈의 차인 포르쉐를 소유하세요</p>
            <Link to="">예약하기</Link>
       </div>
       <h2>내가 저장한 즐겨찾기</h2>
    </main>
  );
}

export default MyPage;
